import React, { useState } from "react";
import "./BookingModal.css";
import logo from '../assets/logo/logo.png'

const BookingModal = ({ onClose }) => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    contact: "",
    state: "",
    city: "",
    description: ""
  });

  const handleChange = e => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = e => {
    e.preventDefault();
    console.log("Form submitted:", formData);
    alert("Your request has been submitted!");
    onClose();
  };

  return (
    <div className="modal-overlay">
      <div className="modal">
        <button className="close-btn" onClick={onClose}>
          &times;
        </button>

        {/* Company Logo */}
        <div className="modal-header">
          <img 
            src={logo} 
            alt="Franmax Expo Logo" 
            className="company-logo" 
          />
          <h2>Book Your Stall</h2>
          <p className="subtitle">Secure your spot at Franmax Expo 2025</p>
        </div>

        {/* Why Book Section */}
        <div className="benefits-section">
          <h3>Why Exhibit With Us?</h3>
          <ul>
            <li>Connect with top investors and franchise owners</li>
            <li>Showcase your brand to 5000+ visitors</li>
            <li>Expand your business across India</li>
            <li>Get exclusive media coverage & leads</li>
          </ul>
        </div>

        {/* Booking Form */}
        <form onSubmit={handleSubmit} className="booking-form">
          <div className="form-row">
            <input
              type="text"
              name="name"
              placeholder="Name"
              value={formData.name}
              onChange={handleChange}
              required
            />
            <input
              type="email"
              name="email"
              placeholder="Email"
              value={formData.email}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-row">
            <input
              type="tel"
              name="contact"
              placeholder="Contact Number"
              value={formData.contact}
              onChange={handleChange}
              required
            />
            <input
              type="text"
              name="state"
              placeholder="State"
              value={formData.state}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-row">
            <input
              type="text"
              name="city"
              placeholder="City"
              value={formData.city}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-row">
            <textarea
              name="description"
              placeholder="Description"
              rows="2"
              value={formData.description}
              onChange={handleChange}
              required
            />
          </div>

          <button type="submit" className="submit-btn">
            Submit
          </button>
        </form>
      </div>
    </div>
  );
};

export default BookingModal;
